            $json['enhancedSchemeData.itemDetailLine[itemNr].quantity']       =
                $this->enhancedSchemeDataItemDetailLineItemNrQuantity;
        }
        if (isset($this->enhancedSchemeDataItemDetailLineItemNrTotalAmount)) {
